import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

function SignUp() {
    const [email, setEmail] = useState('');
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');
    const [phoneNumber, setPhoneNumber] = useState('');
    const [houseNo, setHouseNo] = useState('');
    const [area, setArea] = useState('');
    const [city, setCity] = useState('');
    const navigate = useNavigate();

    const handleSubmit = (event) => {
        event.preventDefault();
        const address = { houseNo, area, city };
        axios
            .post('http://localhost:3001/register', { email, username, password, phoneNumber, address })
            .then(() => {
                alert('Registration Successful');
                setEmail('');
                setUsername('');
                setPassword('');
                setPhoneNumber('');
                setHouseNo('');
                setArea('');
                setCity('');
                navigate('/login');
            })
            .catch((error) => {
                console.log('Unable to register user', error);
            });
    };

    return (
        <div className='w-full h-screen flex'>
            <div className='w-[100%] h-[100%] bg-[#1a1a1a] text-white flex justify-center items-center'>
                <form 
                    className='text-center border border-teal-600 rounded-lg w-[600px] h-auto p-9 shadow-lg' 
                    onSubmit={handleSubmit}>
                    {/* Email Input */}
                    <label>Email</label>
                    <br />
                    <input
                        className='w-[400px] h-[40px] rounded-xl bg-zinc-700 p-2'
                        type='text'
                        placeholder='Email'
                        value={email}
                        onChange={(e) => setEmail(e.target.value)}
                    />
                    <br />
                    <br />
                    {/* Username Input */}
                    <label>Username</label>
                    <br />
                    <input
                        className='w-[400px] h-[40px] rounded-xl bg-zinc-700 p-2'
                        type='text'
                        placeholder='Username'
                        value={username}
                        onChange={(e) => setUsername(e.target.value)}
                    />
                    <br />
                    <br />
                    {/* Password Input */}
                    <label>Password</label>
                    <br />
                    <input
                        className='w-[400px] h-[40px] rounded-xl bg-zinc-700 p-2'
                        type='password'
                        placeholder='Password'
                        value={password}
                        onChange={(e) => setPassword(e.target.value)}
                    />
                    <br />
                    <br />
                    {/* Phone Number Input */}
                    <label>Phone Number</label>
                    <br />
                    <input
                        className='w-[400px] h-[40px] rounded-xl bg-zinc-700 p-2'
                        type='text'
                        placeholder='Phone Number'
                        value={phoneNumber}
                        onChange={(e) => setPhoneNumber(e.target.value)}
                    />
                    <br />
                    <br />
                    {/* Address Inputs */}
                    <label>House No.</label>
                    <br />
                    <input
                        className='w-[400px] h-[40px] rounded-xl bg-zinc-700 p-2'
                        type='text'
                        placeholder='House No.'
                        value={houseNo}
                        onChange={(e) => setHouseNo(e.target.value)}
                    />
                    <br />
                    <br />
                    <label>Area</label>
                    <br />
                    <input
                        className='w-[400px] h-[40px] rounded-xl bg-zinc-700 p-2'
                        type='text'
                        placeholder='Area'
                        value={area}
                        onChange={(e) => setArea(e.target.value)}
                    />
                    <br />
                    <br />
                    <label>City</label>
                    <br />
                    <input
                        className='w-[400px] h-[40px] rounded-xl bg-zinc-700 p-2'
                        type='text'
                        placeholder='City'
                        value={city}
                        onChange={(e) => setCity(e.target.value)}
                    />
                    <br />
                    <br />
                    {/* Button */}
                    <button className='w-[200px] h-[50px] border border-teal-600 hover:bg-teal-900 rounded-xl' type='submit'>
                        Sign Up
                    </button>
                </form>
            </div>
        </div>
    );
}

export default SignUp;
